RecFormat := recformat<label,level,genus,rank,num_known_degree1_points,generators,subgroup>;


function create_record(row)
    out := rec<RecFormat|label:=row[1],level:=row[2],genus:=row[3],rank:=row[4],num_known_degree1_points:=row[5],generators:=row[6]>;
    subgroup := out`level eq 1 select sub<GL(2,Integers())|> else sub<GL(2,Integers(out`level))|out`generators>;
    out`subgroup := subgroup;
    return out;
end function;

function make_data()
    return [create_record(row) : row in data];
end function;

